description:
Det galna Monty Python ganget ar tillbaka i deras mest tokiga aventyr
nagonsin! John Cleese, Graham Chapman, Terry Jones, Eric Idle, Terry
Gilliam och Michael Palin ar tillbaka far att ge oss &quot;meningen med livet&quot;.
Det finns inget heligt for det respektlosa Python ganget. Nar du sett det
genom deras ogon, kommer livet aldrig att bli detsamma.
